import styles from './Charts.module.css';

const Charts = () => {
    const[dailyData,setDailyData] = useState({});
    useEffect(()=>{
        const fetchAPI = async () =>{
           setDailyData(await fetchDailyData());
        }

        console.log(dailyData);

        fetchAPI();
    });

    const lineChart =(
        dailyData[0]?(
            <Line
            data={{
                labels:'',
                datasets:[{},{}],
            }}
            />):null
        );

    return (
        
        <h1>Charts</h1>
    )
}

export default Charts;
